import React from "react";
import style from "./footer.scss";
import Logo2x2 from "../Logo2x2/Logo2x2.jsx";
import logo from "../../images/logo.png";

const Footer = ({
    isMobile
}) => {
    if (!isMobile) {
        return (
            <div className="footer">
                <div className="footer__content">
                </div>
            </div>
        );
    }
    return (
        <div className="footer">
            <div className="footer__content">
                <div className="col1">
                </div>
                </div>
        </div>
    );
};
export default Footer;
